import React from 'react';
import map_encora from '../assets/imgs/map_encora.png';
import styles from "../../css/HomePage.module.css";

const HomePage = () => {
  return (
    <div className={styles.home_page}>
      <NavBar />
      <Container>
        <h1>Welcome to choose your desktop!</h1>
        <Row>
          <Col className={styles.col} sm={6}>
            <LinkButton
              to="/newreservationpage"
              text="Make a booking"
            ></LinkButton>
          </Col>
          <Col className={styles.col} sm={6}>
            <LinkButton
              to="/myreservations"
              text="My bookings"
            ></LinkButton>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Map;
